import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import { Trophy, TrendingUp, Calendar, Filter, BarChart3, Target, Clock, Star, Code, BookOpen, Briefcase, Palette, User, Plus } from 'lucide-react';

const TrackerTab = ({ username = 'Jroc_182', tabColor = '#10B981' }) => {
  const [categories, setCategories] = useState([]);
  const [timeFilter, setTimeFilter] = useState('all'); // 'all', 'month', 'week'
  const [focusEntries, setFocusEntries] = useState([]);
  const [loading, setLoading] = useState(true);
  const [selectedCategory, setSelectedCategory] = useState(null);

  // Load categories and entries
  useEffect(() => {
    loadCategories();
    loadFocusEntries();
  }, [username, timeFilter]);

  const loadCategories = () => {
    const saved = localStorage.getItem('focusCategories');
    if (saved) {
      setCategories(JSON.parse(saved));
    } else {
      // Default categories with gaming theme
      const defaultCategories = [
        { id: 'study', name: 'Study', icon: BookOpen, color: '#3B82F6', xp: 0 },
        { id: 'work', name: 'Work', icon: Briefcase, color: '#10B981', xp: 0 },
        { id: 'read', name: 'Read', icon: BookOpen, color: '#8B5CF6', xp: 0 },
        { id: 'create', name: 'Create', icon: Palette, color: '#F59E0B', xp: 0 },
        { id: 'code', name: 'Code', icon: Code, color: '#EF4444', xp: 0 }
      ];
      setCategories(defaultCategories);
      localStorage.setItem('focusCategories', JSON.stringify(defaultCategories));
    }
  };

  const loadFocusEntries = async () => {
    try {
      setLoading(true);

      // Calculate date range based on filter
      let startDate = null;
      const now = new Date();

      if (timeFilter === 'week') {
        startDate = new Date(now.getTime() - 7 * 24 * 60 * 60 * 1000);
      } else if (timeFilter === 'month') {
        startDate = new Date(now.getFullYear(), now.getMonth(), 1);
      }

      // Build API URL
      let url = `http://localhost:8080/api/focus/entries?username=${username}`;
      if (startDate) {
        const endDate = now.toISOString().split('T')[0];
        startDate = startDate.toISOString().split('T')[0];
        url += `&startDate=${startDate}&endDate=${endDate}`;
      }

      const response = await fetch(url);
      const entries = await response.json();

      setFocusEntries(entries || []);
      updateCategoryXP(entries || []);

    } catch (error) {
      console.error('Error loading focus entries:', error);
      setFocusEntries([]);
    } finally {
      setLoading(false);
    }
  };

  // Update category XP based on entries
  const updateCategoryXP = (entries) => {
    const categoryTotals = {};

    entries.forEach(entry => {
      if (entry.category) {
        categoryTotals[entry.category] = (categoryTotals[entry.category] || 0) + (entry.timeSpent || 0);
      }
    });

    const updatedCategories = categories.map(cat => ({
      ...cat,
      xp: categoryTotals[cat.id] || 0
    }));

    setCategories(updatedCategories);
  };

  // Calculate total XP across all categories
  const totalXP = categories.reduce((sum, cat) => sum + (cat.xp || 0), 0);

  // Get top category
  const topCategory = categories.reduce((top, cat) => 
    (cat.xp || 0) > (top.xp || 0) ? cat : top, categories[0] || {}
  );

  // Format time display
  const formatTime = (minutes) => {
    if (minutes < 60) return `${minutes}m`;
    const hours = Math.floor(minutes / 60);
    const mins = minutes % 60;
    return mins > 0 ? `${hours}h ${mins}m` : `${hours}h`;
  };

  // Calculate level from XP (gaming-style)
  const calculateLevel = (xp) => {
    if (xp === 0) return 1;
    return Math.floor(Math.log2(xp / 15)) + 1; // Level up every ~15min base, exponential
  };

  // Calculate XP needed for next level
  const getXPForNextLevel = (currentXP) => {
    const currentLevel = calculateLevel(currentXP);
    const nextLevelXP = Math.pow(2, currentLevel) * 15;
    return nextLevelXP - currentXP;
  };

  // Get progress to next level
  const getLevelProgress = (xp) => {
    const currentLevel = calculateLevel(xp);
    const currentLevelXP = Math.pow(2, currentLevel - 1) * 15;
    const nextLevelXP = Math.pow(2, currentLevel) * 15;
    const progress = ((xp - currentLevelXP) / (nextLevelXP - currentLevelXP)) * 100;
    return Math.max(0, Math.min(100, progress));
  };

  const hexToRgb = (hex) => {
    const result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    return result ? 
      `${parseInt(result[1], 16)}, ${parseInt(result[2], 16)}, ${parseInt(result[3], 16)}` :
      '16, 185, 129';
  };

  const tabColorRgb = hexToRgb(tabColor);

  if (loading) {
    return (
      <div className="tracker-tab-container p-6">
        <div className="text-center text-green-400 font-mono">
          ⏳ LOADING FOCUS STATS...
        </div>
      </div>
    );
  }

  return (
    <div className="tracker-tab-container p-6">
      {/* Header */}
      <div className="mb-8">
        <h1 className="font-mono text-3xl font-bold text-white mb-2 flex items-center gap-3">
          <div 
            className="w-6 h-6 border border-gray-600" 
            style={{ backgroundColor: tabColor }}
          />
          FOCUS TRACKER
        </h1>
        <p className="text-gray-400 font-mono text-sm">
          XP-based focus analytics and category progression system.
        </p>
      </div>

      {/* Time Filter */}
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        className="bg-gray-800 border-2 shadow-[4px_4px_0px_0px_rgba(0,0,0,1)] p-4 mb-6"
        style={{
          borderColor: tabColor,
          boxShadow: `0 0 15px rgba(${tabColorRgb}, 0.3), 4px 4px 0px 0px rgba(0,0,0,1)`
        }}
      >
        <div className="flex items-center gap-4">
          <Filter size={16} className="text-green-400" />
          <span className="text-sm font-mono text-gray-300">TIME PERIOD:</span>

          <div className="flex gap-2">
            {[
              { id: 'all', label: 'ALL TIME' },
              { id: 'month', label: 'THIS MONTH' },
              { id: 'week', label: 'THIS WEEK' }
            ].map(filter => (
              <button
                key={filter.id}
                onClick={() => setTimeFilter(filter.id)}
                className={`px-3 py-1 text-xs font-mono border transition-colors ${
                  timeFilter === filter.id
                    ? 'border-green-400 bg-green-500 bg-opacity-20 text-green-400'
                    : 'border-gray-600 text-gray-400 hover:border-gray-500'
                }`}
              >
                {filter.label}
              </button>
            ))}
          </div>
        </div>
      </motion.div>

      {/* Overview Stats */}
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ delay: 0.1 }}
        className="grid grid-cols-1 lg:grid-cols-3 gap-6 mb-6"
      >
        {/* Total XP */}
        <div className="bg-gray-800 border-2 border-yellow-500 shadow-[4px_4px_0px_0px_rgba(0,0,0,1)] p-6 relative"
             style={{ boxShadow: '0 0 15px rgba(234, 179, 8, 0.3), 4px 4px 0px 0px rgba(0,0,0,1)' }}>
          <div className="absolute inset-0 bg-gradient-to-br from-yellow-500/10 to-yellow-600/20 pointer-events-none" />
          <div className="relative z-10">
            <div className="flex items-center gap-2 mb-2">
              <Trophy size={20} className="text-yellow-400" />
              <span className="font-mono text-sm text-gray-300">TOTAL XP</span>
            </div>
            <div className="text-2xl font-mono font-bold text-yellow-400">
              {formatTime(totalXP)}
            </div>
            <div className="text-xs font-mono text-gray-400">
              Level {calculateLevel(totalXP)} Focus Master
            </div>
          </div>
        </div>

        {/* Top Category */}
        <div className="bg-gray-800 border-2 border-purple-500 shadow-[4px_4px_0px_0px_rgba(0,0,0,1)] p-6 relative"
             style={{ boxShadow: '0 0 15px rgba(147, 51, 234, 0.3), 4px 4px 0px 0px rgba(0,0,0,1)' }}>
          <div className="absolute inset-0 bg-gradient-to-br from-purple-500/10 to-purple-600/20 pointer-events-none" />
          <div className="relative z-10">
            <div className="flex items-center gap-2 mb-2">
              <Star size={20} className="text-purple-400" />
              <span className="font-mono text-sm text-gray-300">TOP CATEGORY</span>
            </div>
            <div className="text-xl font-mono font-bold text-purple-400">
              {topCategory.name || 'None'}
            </div>
            <div className="text-xs font-mono text-gray-400">
              {formatTime(topCategory.xp || 0)} • Level {calculateLevel(topCategory.xp || 0)}
            </div>
          </div>
        </div>

        {/* Sessions Count */}
        <div className="bg-gray-800 border-2 border-blue-500 shadow-[4px_4px_0px_0px_rgba(0,0,0,1)] p-6 relative"
             style={{ boxShadow: '0 0 15px rgba(59, 130, 246, 0.3), 4px 4px 0px 0px rgba(0,0,0,1)' }}>
          <div className="absolute inset-0 bg-gradient-to-br from-blue-500/10 to-blue-600/20 pointer-events-none" />
          <div className="relative z-10">
            <div className="flex items-center gap-2 mb-2">
              <Target size={20} className="text-blue-400" />
              <span className="font-mono text-sm text-gray-300">SESSIONS</span>
            </div>
            <div className="text-2xl font-mono font-bold text-blue-400">
              {focusEntries.length}
            </div>
            <div className="text-xs font-mono text-gray-400">
              Completed focus sessions
            </div>
          </div>
        </div>
      </motion.div>

      {/* Category Stats */}
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ delay: 0.2 }}
        className="bg-gray-800 border-2 shadow-[8px_8px_0px_0px_rgba(0,0,0,1)] p-6 mb-6"
        style={{
          borderColor: tabColor,
          boxShadow: `0 0 20px rgba(${tabColorRgb}, 0.3), 8px 8px 0px 0px rgba(0,0,0,1)`
        }}
      >
        <div className="flex items-center gap-2 mb-6">
          <BarChart3 size={20} style={{ color: tabColor }} />
          <h3 className="text-lg font-mono font-bold text-white">CATEGORY PROGRESSION</h3>
        </div>

        <div className="space-y-4">
          {categories
            .sort((a, b) => (b.xp || 0) - (a.xp || 0))
            .map(category => {
              const IconComponent = category.icon;
              const level = calculateLevel(category.xp || 0);
              const progress = getLevelProgress(category.xp || 0);
              const xpToNext = getXPForNextLevel(category.xp || 0);

              return (
                <motion.div
                  key={category.id}
                  initial={{ opacity: 0, x: -20 }}
                  animate={{ opacity: 1, x: 0 }}
                  className="bg-gray-900 border p-4 relative group cursor-pointer hover:border-opacity-80 transition-all duration-300"
                  style={{ borderColor: category.color + '60' }}
                  onClick={() => setSelectedCategory(selectedCategory === category.id ? null : category.id)}
                >
                  <div className="absolute inset-0 opacity-5 pointer-events-none"
                       style={{ backgroundColor: category.color }} />

                  <div className="relative z-10">
                    <div className="flex items-center justify-between mb-3">
                      <div className="flex items-center gap-3">
                        <div className="p-2 border border-gray-600"
                             style={{ backgroundColor: category.color + '20', borderColor: category.color }}>
                          <IconComponent size={16} style={{ color: category.color }} />
                        </div>
                        <div>
                          <div className="font-mono font-bold text-white">{category.name}</div>
                          <div className="text-xs font-mono text-gray-400">
                            Level {level} • {formatTime(category.xp || 0)} XP
                          </div>
                        </div>
                      </div>

                      <div className="text-right">
                        <div className="text-sm font-mono font-bold" style={{ color: category.color }}>
                          {formatTime(category.xp || 0)}
                        </div>
                        <div className="text-xs font-mono text-gray-400">
                          {xpToNext > 0 ? `${formatTime(xpToNext)} to Lv${level + 1}` : 'Max Level'}
                        </div>
                      </div>
                    </div>

                    {/* XP Progress Bar */}
                    <div className="w-full bg-gray-700 h-3 border border-gray-600">
                      <motion.div
                        initial={{ width: 0 }}
                        animate={{ width: `${progress}%` }}
                        transition={{ duration: 1, delay: 0.3 }}
                        className="h-full transition-all duration-1000"
                        style={{ 
                          backgroundColor: category.color,
                          boxShadow: `inset 0 1px 0 rgba(255,255,255,0.2), 0 0 10px ${category.color}40`
                        }}
                      />
                    </div>

                    {/* Expanded Details */}
                    {selectedCategory === category.id && (
                      <motion.div
                        initial={{ height: 0, opacity: 0 }}
                        animate={{ height: 'auto', opacity: 1 }}
                        className="mt-4 pt-4 border-t border-gray-700"
                      >
                        <div className="grid grid-cols-3 gap-4 text-xs font-mono">
                          <div className="text-center">
                            <div className="text-gray-400">SESSIONS</div>
                            <div className="text-white font-bold">
                              {focusEntries.filter(e => e.category === category.id).length}
                            </div>
                          </div>
                          <div className="text-center">
                            <div className="text-gray-400">AVG SESSION</div>
                            <div className="text-white font-bold">
                              {focusEntries.filter(e => e.category === category.id).length > 0
                                ? formatTime(Math.round((category.xp || 0) / focusEntries.filter(e => e.category === category.id).length))
                                : '0m'}
                            </div>
                          </div>
                          <div className="text-center">
                            <div className="text-gray-400">RANK</div>
                            <div className="text-white font-bold">
                              #{categories.sort((a, b) => (b.xp || 0) - (a.xp || 0)).findIndex(c => c.id === category.id) + 1}
                            </div>
                          </div>
                        </div>
                      </motion.div>
                    )}
                  </div>
                </motion.div>
              );
            })}
        </div>
      </motion.div>

      {/* Recent Sessions */}
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ delay: 0.3 }}
        className="bg-gray-800 border-2 shadow-[8px_8px_0px_0px_rgba(0,0,0,1)] p-6"
        style={{
          borderColor: tabColor,
          boxShadow: `0 0 20px rgba(${tabColorRgb}, 0.3), 8px 8px 0px 0px rgba(0,0,0,1)`
        }}
      >
        <div className="flex items-center gap-2 mb-6">
          <Clock size={20} style={{ color: tabColor }} />
          <h3 className="text-lg font-mono font-bold text-white">RECENT SESSIONS</h3>
        </div>

        <div className="space-y-2 max-h-64 overflow-y-auto">
          {focusEntries.slice(0, 10).map(entry => {
            const category = categories.find(c => c.id === entry.category);
            const IconComponent = category?.icon || Clock;

            return (
              <div
                key={entry.id}
                className="bg-gray-900 border border-gray-600 p-3 text-xs font-mono"
              >
                <div className="flex items-center justify-between">
                  <div className="flex items-center gap-2">
                    <IconComponent size={12} style={{ color: category?.color || '#6B7280' }} />
                    <span className="text-white">{category?.name || 'Unknown'}</span>
                    <span className="text-gray-400">•</span>
                    <span className="text-gray-400">{formatTime(entry.timeSpent || 0)}</span>
                  </div>
                  <div className="text-gray-400">
                    {new Date(entry.createdAt).toLocaleDateString()}
                  </div>
                </div>
                {entry.notes && (
                  <div className="text-gray-500 mt-1 truncate">{entry.notes}</div>
                )}
              </div>
            );
          })}

          {focusEntries.length === 0 && (
            <div className="text-center py-8 text-gray-400 font-mono">
              <Target size={32} className="mx-auto mb-2 opacity-50" />
              <div>No focus sessions yet</div>
              <div className="text-xs mt-1">Complete your first session to see stats here!</div>
            </div>
          )}
        </div>
      </motion.div>
    </div>
  );
};

export default TrackerTab;
